  false,\n\t\"url\": null,\n\t\"notes\": \"Reson 8101ER multibeam Data were collected
  between 29 July - 8 August 2003 (JD 210-220) aboard NOAA Survey Launch Acoustic
  Habitat Investigator (AHI) at Midway Islands in the Northwestern Hawaiian Islands
  in the north Pacific during cruise OES-03-06/AHI-03-06. The AHI was deployed independently
  from the NOAA Ship Oscar Elton Sette (OES). The multibeam data were logged into
  data set Midway and collected using SAIC ISS-2000 software in the Generic Sensor
  Format and processed using SABER editing software. Sound velocity corrections from
  a Seabird SBE19 CTD sensor and motion corrections from a POS-MV vertical reference
  were applied to the data in real time. Observed tides from Midway tide gauge (1619910)
  were applied using SABER postprocessing software. Horizontal accuracy is 20m (no
  differential GPS correctors applied), vertical accuracy is depth dependent (~1%
  of water depth), WGS84 datum. These data are not to be used for navigation. Depths
  mapped range from 10 - 300 m. These multibeam bathymetric data in generic sensor
  format from AHI0402 were submitted to NOAA's National Geophysical Data Center (NGDC)
  in Boulder, CO, for distribution in 2005.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
